userDefinedLinkHintCss:
/* Change the font, text color, and background color of the link hints */
div > .vimiumHintMarker span {
  font-family: -apple-system, BlinkMacSystemFont, sans-serif;
  font-size: 10px;
  color: #1d1d1e;
  background-color: None;
}

/* Add a box shadow and border radius to the link hints */
div > .vimiumHintMarker {
  box-shadow: 0px 0px 12px #a9b665;
  border-radius: 2px;
}
